import React from "react";
import { Navbar, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <Navbar sticky="bottom" className="bg-light">
      <Row>
        <Col lg={4}></Col>
        <Col lg={4}></Col>
        <Col lg={4}></Col>
      </Row>
    </Navbar>
  );
};

export default Footer;
